==Trivia==
* According to the original developer for [[Desert Treasure]], the [[stranger]] is a [[Temple Knight]] assassin sent after the player personally by Sir Tiffy Cashien in order to prevent the release of [[Azzanadra]].{{CiteReddit|author=Mod James|url=https://www.reddit.com/r/2007scape/comments/4hha91/i_used_to_work_on_rs_ask_me_selected_things/d2pos0v/|title=I used to work on RS, Ask Me Selected Things?|quote=This falls squarely into the "foreshadowing future stuff I never got round to" category XD He's a Temple Knight assassin dispatched personally by Sir Tiffy to prevent Azzanadras release - what WHAT???|date=2 May 2016|archiveurl=http://archive.fo/EvqUS|archivedate=October 6 2018|notes=}}
* "Sir Tiffy Cashien" is likely a word play with the word "certification", which is increasingly likely seeing as it is Sir Tiffy Cashien that gives you the certifications to buy certain white knight items.

